webpackJsonp([34829346327640],{633:function(a,e){a.exports={data:{markdownRemark:{html:'<h3>The 90 Day Leaderboard</h3>\n<p>The new rolling 90 day leaderboard ranks hackers based on their score from this calculation: <strong>Reputation x Signal Percentile x Impact Percentile</strong>.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/april_2018_leaderboard-bbbd115d135d655c3a290abf9476b8fd-d6cb1.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 31.569343065693428%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="april_2018_leaderboard"\n        title=""\n        src="/static/april_2018_leaderboard-bbbd115d135d655c3a290abf9476b8fd-2f183.png"\n        srcset="/static/april_2018_leaderboard-bbbd115d135d655c3a290abf9476b8fd-67829.png 125w,\n/static/april_2018_leaderboard-bbbd115d135d655c3a290abf9476b8fd-5c59f.png 250w,\n/static/april_2018_leaderboard-bbbd115d135d655c3a290abf9476b8fd-2f183.png 500w,\n/static/april_2018_leaderboard-bbbd115d135d655c3a290abf9476b8fd-c93e8.png 750w,\n/static/april_2018_leaderboard-bbbd115d135d655c3a290abf9476b8fd-4e628.png 1000w,\n/static/april_2018_leaderboard-bbbd115d135d655c3a290abf9476b8fd-b3ac4.png 1500w,\n/static/april_2018_leaderboard-bbbd115d135d655c3a290abf9476b8fd-d6cb1.png 2192w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Needs More Info</h3>\n<p>When a program member adds a comment to an open report with a question mark, Hackbot will prompt them asking if they want to change the state of the report to Needs more info.\n\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/april_2018_nmi-a1745b5469c4677fe5bd527b3b1bac8b-10ffe.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 31.603773584905664%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="april_2018_nmi"\n        title=""\n        src="/static/april_2018_nmi-a1745b5469c4677fe5bd527b3b1bac8b-2f183.png"\n        srcset="/static/april_2018_nmi-a1745b5469c4677fe5bd527b3b1bac8b-67829.png 125w,\n/static/april_2018_nmi-a1745b5469c4677fe5bd527b3b1bac8b-5c59f.png 250w,\n/static/april_2018_nmi-a1745b5469c4677fe5bd527b3b1bac8b-2f183.png 500w,\n/static/april_2018_nmi-a1745b5469c4677fe5bd527b3b1bac8b-c93e8.png 750w,\n/static/april_2018_nmi-a1745b5469c4677fe5bd527b3b1bac8b-4e628.png 1000w,\n/static/april_2018_nmi-a1745b5469c4677fe5bd527b3b1bac8b-10ffe.png 1272w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Response Efficiency Timers</h3>\n<p>Response efficiency timers no longer trigger for reports submitted by internal members of the program. </p>\n<h3>Auto-Invites for Controlled Programs</h3>\n<p>Programs in controlled launch mode are no longer able to toggle auto-invites as on or off. To change their settings for invitations, they can contact HackerOne support. </p>\n<h3>Bug Fixes</h3>\n<ul>\n<li>URLs in the report title are now wrapped so that they aren’t crossing out of the inbox. </li>\n<li>The Program Health Dashboard now displays 0 instead of N/A when there are no missed or failed reports. </li>\n<li>When a hacker leaves a program that they got invited to through the email forwarding feature, they won’t be placed in the priority queue for leaving that program. This prevents hackers from harvesting a ton of private invitations. </li>\n<li>Hackers now don’t receive invitations to programs they’ve left. </li>\n<li>When hackers received an invitation to claim a report, they couldn’t see or accept the terms of the program. Now they can actually claim the report and see the terms of the program. </li>\n</ul>',frontmatter:{path:"/changelog/2018/april",title:"April 2018"}}},pathContext:{}}}});
